input = "dabAcCaCBAcCcaDA"

input = ""

strings = Array(?A..?Z).zip(Array(?a..?z))
strings += strings.map(&:reverse)
strings.map!(&:join)
part1 = input.dup

changed = true
while changed
  changed = false

  strings.each do |string|
    if part1.gsub!(string, '')
      changed = true
    end
  end
end

puts "Part 1: #{part1.size}"

part2_size = Float::INFINITY
strings = Array(?A..?Z).zip(Array(?a..?z))

strings.each do |string|
  part2 = input.dup
  new_strings = strings.dup
  new_strings -= [string]
  new_strings += new_strings.map(&:reverse)
  new_strings.map!(&:join)
  part2.gsub!(string[0], '')
  part2.gsub!(string[1], '')

  changed = true
  while changed
    changed = false

    new_strings.each do |str|
      if part2.gsub!(str, '')
        changed = true
      end
    end
  end

  part2_size = [part2_size, part2.size].min
end

puts "Part 2: #{part2_size}"
